import React from 'react';
import { Avatar } from '@material-ui/core';
import './Chat.css';

export default function Chat() {
	return (
		<div className='chat'>
			<div className='chat__header'>
				<Avatar />
			</div>
			<div className='chat__body'></div>
			<div className='chat__footer'></div>
		</div>
	);
}
